Phaserfroot.PluginManager.register(
  "player_controls_gfbjs",
  class player_controls_gfbjs extends Phaserfroot.Component {
    constructor( target, instanceProperties ) {
      super( {
        name: "player_controls_gfbjs",
        owner: target,
      } );
      this.instanceProperties = instanceProperties;
      this.scene = target.scene;
      this.game = target.scene.game;

      this.owner.once( "levelSwitch", this.destroy, this );

      // Attach custom event listeners.
      this.onTick_ = this.scene.time.addEvent( {
        delay: 100,
        loop: true,
        callback: function () {
          if ( !this.owner || this.owner.exists === false ) {
            return;
          }
          this.onTick();
        },
        callbackScope: this,
      } );
      this.owner.properties.onUpdate( this.onMessageReceived, this, "_messaging_");
      this.owner.on( this.owner.EVENTS.LEVEL_START, this.onLevelStart2, this );
      this.scene.getKey( 68 ).on( "down", this.onKeyInput68, this );
      this.scene.getKey( 68 ).on( "up", this.onKeyInput682, this );
      this.scene.getKey( 65 ).on( "down", this.onKeyInput65, this );
      this.scene.getKey( 65 ).on( "up", this.onKeyInput652, this );
      this.scene.getKey( 87 ).on( "down", this.onKeyInput87, this );
      this.owner.on( this.owner.EVENTS.COLLIDE, this.onTouchInstance2, this );


      // Initialize properties from parameters.
      this.value = instanceProperties[ "value" ];
      this.score = instanceProperties[ "score" ];
      this.toucher = ( typeof instanceProperties[ "toucher" ] !== "undefined" ) ? this.scene.getChildById( instanceProperties[ "toucher" ], true ) : null;
      this.textfield = ( typeof instanceProperties[ "textfield" ] !== "undefined" ) ? this.scene.getChildById( instanceProperties[ "textfield" ], true ) : null;
      this.bg_music = instanceProperties[ "bg music" ];


      // Boot phase.
      this.camera = this.scene.cameras.main;

      this.onCreate();

    }

    // BUILT-IN METHODS

    preUpdate () {

    }

    update () {
      this.EVENTS_UPDATE();

    }

    postUpdate () {

    }

    destroy () {
      this.owner.off( "levelSwitch", this.destroy, this );

      // Detach custom event listeners.
      if ( this.onTick_ ) {
        this.onTick_.remove();
      }
      this.owner.removeListener( this.owner.EVENTS.LEVEL_START, this.onLevelStart2, this );
      this.scene.getKey( 68 ).off( "down", this.onKeyInput68, this );
      this.scene.getKey( 68 ).off( "up", this.onKeyInput682, this );
      this.scene.getKey( 65 ).off( "down", this.onKeyInput65, this );
      this.scene.getKey( 65 ).off( "up", this.onKeyInput652, this );
      this.scene.getKey( 87 ).off( "down", this.onKeyInput87, this );
      this.owner.off( this.owner.EVENTS.COLLIDE, this.onTouchInstance2, this );

    }

    // CUSTOM METHODS

    onCreate () {
      // Executed when this script is initially created.
      this.owner.tags.add( 'player' );
    }

    onTick () {
      // Executed after time period of time.
      this.scene.messageExternal( 'my x pos', this.owner.posX );
      this.scene.messageExternal( 'my y pos', this.owner.posY );
    }

    executeMessageset_x_pos () {
      // Executed when the 'set x pos' is received.
      this.owner.posX = this.value;
    }

    executeMessageset_y_pos () {
      // Executed when the 'set y pos' is received.
      this.owner.posY = this.value;
    }

    onKeyInput68 () {
      this.owner.body.velocity.x = 200;
      this.owner.playMy( 'run' );
      this.owner.flipX = false;
    }

    onKeyInput682 () {
      this.owner.body.velocity.x = 0;
      this.owner.playMy( 'idle' );
    }

    onKeyInput65 () {
      this.owner.body.velocity.x = (-200);
      this.owner.playMy( 'run' );
      this.owner.flipX = true;
    }

    onKeyInput652 () {
      this.owner.body.velocity.x = 0;
      this.owner.playMy( 'idle' );
    }

    onKeyInput87 () {
      if (( this.owner.body.touching.down || this.owner.body.blocked.down )) {
        this.owner.body.velocity.y = (-500);
      }
    }

    EVENTS_UPDATE () {
      // Executed every frame.
      this.camera.centerOn( this.owner.x, this.owner.y );
      if ( !this.textfield ) {
        this.reportError( "`Set Instance X` block could not find the instance [textfield]." );
        return;
      }
      this.textfield.posX = this.camera.posX;
      if ( !this.textfield ) {
        this.reportError( "`Set Instance Y` block could not find the instance [textfield]." );
        return;
      }
      this.textfield.posY = this.camera.posY;
    }

    onMessageReceived ( name, message ) {

      if ( message === 'set x pos' ) {
        this.value = this.owner.properties.get( "_messaging-value_" );
        this.executeMessageset_x_pos();
      }

      if ( message === 'set y pos' ) {
        this.value = this.owner.properties.get( "_messaging-value_" );
        this.executeMessageset_y_pos();
      }

    }

    checkScene( message ) {
      if ( !this.scene.add ) {
        this.game.reportError( message, message, 'SCRIPT ERROR' );
      }
    }

    onLevelStart2() {
      this.scene.physics.world.gravity.y = 1000;
      this.owner.body.allowGravity = true;
      this.score = 0;
      this.checkScene( "Create Text block did not work, likely because the level changed before it was triggered.\n\nSuggestion: check whether the level has changed before running this section of code." );
      this.textfield = this.scene.addText( { x: 0, y: 0, textText: (String(this.score) + ' POINTS') } );
      this.scene.components.getByName( "SoundManager" )[ 0 ].playMusic( this.bg_music );

    }

    reportError( message ) {
      message = "(" + this.name.replace( /_[\d]+$/, "" ) + ")" + message;
      console.trace( message );
      this.game.reportError( message, message, "SCRIPT ERROR" );
    }

    errorCheckNotNull( input, backup, message ) {
      if( !input ) {
        this.reportError( message );
        return backup;
      }
      return input;
    }

    errorCheckNotNull2( input, backup, message ) {
      if( !input ) {
        this.reportError( message );
        return backup;
      }
      return input;
    }

    onTouchInstance2 ( instance ) {
      if ( !instance ) {
        return;
      }
      if ( instance instanceof Phaser.Tilemaps.Tile ) {
        instance = instance.layer.tilemapLayer;
      }
      this.toucher = instance;
        if ((this.errorCheckNotNull( this.toucher, this.owner, "`Instance has Tag` block could not find an instance named [toucher].")).tags.has( 'coin' )) {
        this.score = this.score + 1;
        if ( !this.textfield ) {
          this.reportError( "`Set Text on Text` block could not find an instance called [textfield]." );
          return;
        }
        this.textfield.components.getByName( "TextAutomation" )[ 0 ].text = (String(this.score) + ' POINTS');
        if ( !this.toucher ) {
          this.reportError( "`Destroy` block could not find the instance [toucher]." );
          return;
        }
        this.toucher.destroySafe();
      }
      if ((this.errorCheckNotNull2( this.toucher, this.owner, "`Instance has Tag` block could not find an instance named [toucher].")).tags.has( 'level end' )) {
        if (this.score > 5) {
          if ( 1 <= ( this.game.levelManager.levels.indexOf( this.scene ) + 2 ) && ( this.game.levelManager.levels.indexOf( this.scene ) + 2 ) <= this.game.levelManager.levels.length ) {
            this.game.levelManager.switchTo( ( this.game.levelManager.levels.indexOf( this.scene ) + 2 ) );
          } else {
            ( function() {
              var message = "`Go to level` block could not go to level number ( this.game.levelManager.levels.indexOf( this.scene ) + 2 ). Level numbers start at 1 and go up to the total number of levels in your game (" + this.game.levelManager.levels.length + ").";
              this.game.reportError( message, message, "SCRIPT ERROR" );
            } ).bind( this )();
          }
        }
      }

    }

  }
);

