    }

    // BUILT-IN METHODS

    preUpdate () {

    }

    update () {
      this.EVENTS_UPDATE();

    }

    postUpdate () {

    }

    destroy () {
      this.owner.off( "levelSwitch", this.destroy, this );

      // Detach custom event listeners.
      this.owner.off( this.owner.EVENTS.COLLIDE, this.onTouchInstance2, this );

    }

    // CUSTOM METHODS

    onCreate () {
      // Executed when this script is initially created.
      this.owner.body.immovable = true;
      this.start_position = this.owner.posX;
      this.end_position = this.owner.posX + 200;
      this.movement_direction = 1;
    }

    EVENTS_UPDATE () {
      // Executed every frame.
      if (!!( this.owner.body.touching.none && this.owner.body.blocked.none )) {
        this.owner.body.velocity.x = 0;
      }
    }

    reportError( message ) {
      message = "(" + this.name.replace( /_[\d]+$/, "" ) + ")" + message;
      console.trace( message );
      this.game.reportError( message, message, "SCRIPT ERROR" );
    }

    errorCheckNotNull( input, backup, message ) {
      if( !input ) {
        this.reportError( message );
        return backup;
      }
      return input;
    }

    onTouchInstance2 ( instance ) {
      if ( !instance ) {
        return;
      }
      if ( instance instanceof Phaser.Tilemaps.Tile ) {
        instance = instance.layer.tilemapLayer;
      }
      this.toucher = instance;
        if ((this.errorCheckNotNull( this.toucher, this.owner, "`Instance has Tag` block could not find an instance named [toucher].")).tags.has( 'player' )) {
        if (this.owner.posX <= this.start_position) {
          this.movement_direction = 1;
        } else if (this.owner.posX >= this.end_position) {
          this.movement_direction = -1;
        }
        this.owner.body.velocity.x = (100 * this.movement_direction);
      }

    }

  }
);
